// App.js or index.js
import React from 'react';
import { DarkModeProvider } from './DarkModeContext';
import DarkModeToggle from './DarkModeToggle';

function App() {
    return (
        <DarkModeProvider>
            <div className="App">
                <header className="App-header">
                    <p>Hi : )</p>
                    <DarkModeToggle />
                </header>
            </div>
        </DarkModeProvider>
    );
}

export default App;
